import react, {useState, useMemo, useCallback} from 'react'

const App3 = () => {

    let [count, setCount] = useState(0);
    let [item, setItem] = useState(0);

    let newCount = useCallback(()=>{
      
        setCount(count+1);
      
    },[count]);
    let incItem = ()=>{
        setItem(item+1);
    }
   
    // let hello = ()=>{
