    // }

    // let helloMemo = useMemo(()=>{
    //   console.log("##########################");
    //   return "rohit";
    // },[count]);




  return (
    <>
        <br />
        <br />
        <button onClick={newCount}>Increse Count</button>
        <button onClick={incItem}>Increse Item</button>
        <br />
        <h1>Count ---- {count}</h1>
        <h1>Item ---- {item}</h1>
        <br />
        {/* <h1>{helloMemo}</h1> */}
        
    </>
  )
}

export default App3
